import React from 'react'

import Card from './Card'

function CardContainer({quotes}) {
    return (
        <section>
                 {
            quotes.map((quote, i) => {
            return (
                <Card
                key={i}
                quote={quote}
                />
            );
            })
        }

        </section>
    )
}

export default CardContainer
